text:
#javascript 
Substraer un día de un objeto Date():
let dia = new Date();
dia.setDate(dia.getDate() - 1;

eng_text:
#javascript
Subtract a day from a Date() object:
let day = new Date();
day.setDate(day.getDate() - 1;

